I strongly recommend making a test.rs file alongside main.rs to keep your tests in. Of course, you don't have to. You could keep your tests as loose functions in main.rs, or maybe have a submodule in main.rs. Again, I recommend making a tests.rs file and keeping them in there. Here's how I set things up. // tests.rs;
use rubric::TestData; fn test_from_tests_rs(_: &TestData) -> bool { // test code goes here return true;
} // more tests here... // main.rs
extern crate rubric; // declare tests.rs as a module
mod tests;
// bring all test functions into scope
use tests::*;
// ...
